import React from 'react';
import './App.css';
import Navigation from "./ui/menu/Navigation/Navigation";
import {BrowserRouter, Route, Routes, Redirect} from "react-router-dom";
function App() {
    return (
        <BrowserRouter>
            <div className="App">
                <Navigation />
                <Routes>
                    <Route path="terminal"></Route>
                    <Redirect to="home" push />
                </Routes>
            </div>
        </BrowserRouter>
    );
}

export default App;
